> I'm not sure if it is a good idea to have the same name for both the class and the object. It might be confusing in some cases. It's just an example. The real names would be different of course. The problem with this approach is that you can only use one instance at a time. If you want to create another instance, you need to change the name of the first one. You could also make the instances global variables: ```
class MyClass(object):
    def __init__(self, name):
        self._name = name
